// MenuComponent.jsx
import React from 'react';
import styles from './styles.module.css'; // Import CSS module styles

const MenuComponent = () => {
  // Define menu items data (you can customize this as needed)
  const menuItems = [
    { id: 1, icon: 'home.png', name: 'Dashboard' },
    { id: 2, icon: 'temperature.png', name: 'Temperature' },
    { id: 3, icon: 'PH.png', name: 'pH' },
    { id: 4, icon: 'conductivity.png', name: 'Conductivity' },
    { id: 5, icon: 'turbidity.png', name: 'Turbidity' },
    { id: 6, icon: 'standards.png', name: 'Standards' },
    { id: 7, icon: 'account.png', name: 'Account' },
    { id: 8, icon: 'setting.png', name: 'Settings' },
  ];

  return (
    <div className={styles.menu}>
      {menuItems.map(item => (
        <div key={item.id} className={styles.menuItem}>
          <img src={require(`./public/images/${item.icon}`).default} className={styles.icon} alt="Icon" />
          <div className={styles.name}>{item.name}</div>
        </div>
      ))}
    </div>
  );
};

export default MenuComponent;
